D4_94cc2a04ad62289c5b91357e2c4ef4964b064c3ae780c9bd542f695c61022d04 = "ADP is hiring a Fullstack Angular Developer with demonstrated experience in Angular, Javascrpt, and Java8. Does this sound like you? We believe people make great companies, not the other way around. Our people make all the difference in delivering innovative HR technologies and solutions that help employees all over the world do their jobs better. The result? We're building the next generation of ADP technologies. Join ADP's innovation lab as we undertake one of ADP's most ambitious transformation initiatives ever. We're building a team from of the most elite, game-changing technologists and asking them to reinvent the way millions of employees are paid worldwide. If you are a sharp, self-driven product manager who is passionate about solving really big problems, we want to talk to you. Job Description The Lead Application Developer -- UI is responsible for developing software solutions for ADP's external and internal clients. Will be involved in all aspects of the agile software development life cycle. Will work under guidance with other members of scrum team to design, develop and test solutions consistent with the business objectives. Lead Application Developers at ADP are expected to be results-oriented, learn new and legacy technologies, have knowledge of the relevant platforms and environments, and be familiar with business process, functions and data to provide innovative, insightful, and secure user interface. Responsibilities: Design, coding and testing Angular based application independently Participate in agile development activities including SBE (specification-by-example) for requirements and event-storming session Creating and consuming REST, JSON-based API Work with product owners, UX and other business partners to define best user experience Perform code reviews, test automation, end-to-end testing etc. and other duties as required Experiment with new technologies and innovative ways to solve problem Lead development team to deliver in the CI / CD way with test-driven development mindset QUALIFICATIONS: Bachelor's or Master's degree in Computer Science, Software Engineering, HCI or similar 8 years of software development experience Angular, React, Backbone or other client-side MVC experience Experience with JavaScript build tools and dependency management (npm, bower, grunt, gulp) 5 years of HTML, CSS, and JavaScript experience Experience in creating responsive designs (Bootstrap, mobile, etc.) Experience with unit and automation testing (Jasmine, Protractor, JUnit) Experience with Java 8 and Spring ecosystem Knowledge of Java build tools and dependency management (gradle, maven) REST API design and implementation Experience in relational database such as MySQL, PostgreSQL, or Oracle. Strong collaboration and communications skills, i.e., work well in an open-seating team environment. PREFERRED QUALIFICATIONS: Knowledge of web components, ES6 and typescript. Experience with CSS preprocessors (less, sass) Knowledge of Domain Driven Design concepts and microservices Knowledge of virtualization approaches such as docker containers Knowledge of event sourcing and distributed message systems such as Amazon SNS #LITECH #LI-AA2 We're designing a better way to work, so you can achieve what you're working for. Consistently named one of the 'Most Admired Companies' by FORTUNE® Magazine, and recognized by DiversityInc® as one of the 'Top 50 Companies for Diversity,' ADP works with more than 740,000 organizations across the globe to help their people work smarter, embrace new challenges, and unleash their talent. \"Always Designing for People\" means we're creating platforms that will transform how great work gets done, so together we can unlock a world of opportunity. At ADP, we believe that diversity fuels innovation. ADP is committed to equal employment opportunities regardless of race, color, genetic information, creed, religion, sex, sexual orientation, gender identity, lawful alien status, national origin, age, marital status, or protected veteran status. We support an inclusive workplace where associates excel based on personal merit, qualifications, experience, ability, and job performance."
D5_b38ba1e9410d66ad5d319c95830df8a0b95f8f1c99fc0379eac64d23b76e2c5f = "Description Job Description: The Systems for Inspections, Recalls, Compliance Enforcement (SIRCE) and Imports program supports the Food and Drug Administration (FDA) Office of Regulatory Affairs' (ORA) critical work to safeguard the foods, drugs, devices, biologics, and veterinary products that the Agency regulates. These systems continue to evolve to meet emerging business needs and to support new mandates and initiatives. It is important to respond to customer needs and issues. The Offline Developer position supports the eNSpect development team in developing a Software solution for offline inspections for field agents. Specific roles & responsibilities for the .NET and WPF Offline SW Development position include but not limited to the following: Development of Offline code using .NET and WPF Responding to defects from production system Performing code inspections Collaboration with the Business Analysts, test team and leads Documentation for customer deliverables Update of assigned tasks in ALM Ability to very quickly ramp up to understand code, provide updates, design inputs, interfaces to other applications within the eNSpect solution (Online and Oracle DB interfaces) BS degree and 2 - 4 years of prior relevant experience or Masters with less than 2 years of prior relevant experience Minimum Qualifications Min least 2-5 years .NET experience and programming with C# Min least 1 year working experience with .Net WPF and associated Design Patterns Experience working with Entity Framework, LINQ Experience building Windows Standalone applications with personal database servers Experience working with Oracle or any other RDBMS, writing and executing SQL Queries, Experience working in an Agile Work Environment and knowledge of scrums and sprints Agile development experience Code inspection experience Strong verbal and written communications skills Ability to clearly articulate key technical concepts and ideas. Ability to work well in a team environment spanning multiple locations. Ability to work independently and with a team Desired skills: Word Automation, Oracle Policy Modeling or experience or other Rules Engines , SQL Anywhere Mobilink server experience or knowledge Working knowledge of ALM (workload tracking) Working knowledge of JIRA (production ticket system) # Years' experience - 2-5 Years SW Development experience in .NET HHSFDA External Referral Bonus: Ineligible Potential for Telework: No Clearance Level Required: Public Trust Travel: No Scheduled Weekly Hours: 40 Shift: Day Requisition Category: Professional Job Family: Software Development Leidos is a Fortune 500® information technology, engineering, and science solutions and services leader working to solve the world's toughest challenges in the defense, intelligence, homeland security, civil, and health markets. The company's 33,000 employees support vital missions for government and commercial customers. Headquartered in Reston, Virginia, Leidos reported annual revenues of approximately $10.19 billion for the fiscal year ended December 28, 2018. For more information, visit www.Leidos.com . Pay and benefits are fundamental to any career decision. That's why we craft compensation packages that reflect the importance of the work we do for our customers. Employment benefits include competitive compensation, Health and Wellness programs, Income Protection, Paid Leave and Retirement. More details are available here . Leidos will never ask you to provide payment-related information at any part of the employment application process. And Leidos will communicate with you only through emails that are sent from a Leidos.com email address. If you receive an email purporting to be from Leidos that asks for payment-related information or any other personal information, please report the email to spam.leidos@leidos.com . All qualified applicants will receive consideration for employment without regard to sex, race, ethnicity, age, national origin, citizenship, religion, physical or mental disability, medical condition, genetic information, pregnancy, family structure, marital status, ancestry, domestic partner status, sexual orientation, gender identity or expression, veteran or military status, or any other basis prohibited by law. Leidos will also consider for employment qualified applicants with criminal histories consistent with relevant laws."
